import { Link, useParams } from 'react-router-dom';
import { GrPrevious } from 'react-icons/gr';

const CommentGoBack = () => {
	const { id } = useParams();
	return (
        <Link className="commentGoBack" to={`/blogs/${id}`}>
            <GrPrevious />
            Back to Blog
        </Link>
	);
};

export default CommentGoBack;
